import './global.css';

import { useScrollToTop } from './hooks/use-scroll-to-top';

import myRoutes from './routes/sections';
import ThemeProvider from './theme';
import {Router} from 'react-router-dom'

// ----------------------------------------------------------------------

export default function AdminApp() {
  useScrollToTop();

  return (
    <ThemeProvider>
      <Router>
        <myRoutes />
        </Router>
    </ThemeProvider>
  );
}
